import React, { Component } from 'react'
import { connect } from 'react-redux'

export class CurrentInfo extends React.Component {
  render() {
    return (
      <div>
        <h3>Current Information</h3>

        <span>User Name: </span>
        <div>{this.props.userState.username}</div>
        <span>Email: </span>
        <div>{this.props.userState.email}</div>
        <span>Zipcode: </span>
        <div>{this.props.userState.address.zipcode}</div>
        <span>Phone: </span>
        <div>{this.props.userState.address.phone}</div>
        <span>Password: </span>
        <div>**********</div>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        userState: state.riceZoneApp.currentUserState
    }
  };

const mapDispatchToProps = {}

export default connect(mapStateToProps, mapDispatchToProps)(CurrentInfo)
